import React, { Component } from 'react'
import './App.css'

import MovieList from './components/MovieList'
import LoginUser from './components/LoginUser'

class App extends Component {
  constructor (props) {
    super(props)
    this.onLoginCallback = this.onLoginCallback.bind(this)
    this.state = {
      login_data: { username: '', key: '' }
    }
  }

  onLoginCallback (user, key) {
    // const login_data = this.state.login_data
    // login_data.username = user
    // login_data.key = key
    // this.setState({ login_data: login_data })
  }

  render () {
    const { login_data } = this.state
    return (
      <div>
        {login_data.key !== '' ? <MovieList login_data={login_data} /> : <LoginUser loginCallback={this.onLoginCallback} />}
      </div>
    )
  }
}

export default App
